import React, {Component}  from 'react';
import './head.css'

class LiName extends Component {
    render() {
        const li_name = [
            "РЕСИВЕРЫ",
            "VOD",
            "iT",
            "SHOW-roomы",
            "заказы",
            "EPG",
            "Каналы",
            "Баги (:"
        ]

    var li_map =  li_name.map((value)=>{
        // console.log(value)
       return <li className="li"><a>{value}</a></li>
    })
       return li_map
    }
  }

class Head_ul extends Component {
    render() {
        return (
            <LiName />
        )
    }
  }

  export default Head_ul;
